# Import DiffSynth components
def timeout_handler(signum, frame):
    raise TimeoutError("Processing exceeded time limit")

def with_timeout(timeout=600):
    """Decorator to add timeout to a function"""
    def decorator(func):
        @wraps(func)
        def wrapper(*args, **kwargs):
            # Set the signal handler
            signal.signal(signal.SIGALRM, timeout_handler)
            signal.alarm(timeout)  # Set alarm for timeout seconds
            
            try:
                result = func(*args, **kwargs)
                signal.alarm(0)  # Disable the alarm
                return result
            except TimeoutError as e:
                signal.alarm(0)  # Disable the alarm
                raise TimeoutError(f"Operation timed out after {timeout} seconds")
            
        return wrapper
    return decorator

def install_missing_packages():
    """Install missing packages at runtime."""
    missing_packages = []

    try:
        from diffsynth import ModelManager, WanVideoPipeline
        return ModelManager, WanVideoPipeline
    except ImportError:
        missing_packages.append("diffsynth")

    if missing_packages:
        print(f"Installing missing packages: {missing_packages}")
        import subprocess

        # Install DiffSynth-Studio
        try:
            subprocess.run([
                "pip", "install", "--no-cache-dir",
                "git+https://github.com/modelscope/DiffSynth-Studio.git"
            ], check=True, timeout=300)
            print("‚úÖ DiffSynth-Studio installed successfully")
        except (subprocess.CalledProcessError, subprocess.TimeoutExpired) as e:
            print(f"‚ùå Failed to install DiffSynth-Studio: {e}")
            raise ImportError("Could not install DiffSynth-Studio")

        # Try importing again
        try:
            from diffsynth import ModelManager, WanVideoPipeline
            return ModelManager, WanVideoPipeline
        except ImportError as e:
            print(f"‚ùå Still cannot import DiffSynth after installation: {e}")
            raise

# Install and import DiffSynth
ModelManager, WanVideoPipeline = install_missing_packages()

