def load_models():
    """Load all required models for FantasyTalking."""
    global pipe, fantasytalking, wav2vec_processor, wav2vec

    print("Loading models...")
    print("‚ö†Ô∏è Note: High CPU usage is normal during model loading (2-3 minutes)")

    # Monitor CPU usage
    try:
        import psutil
        cpu_percent = psutil.cpu_percent(interval=1)
        memory_info = psutil.virtual_memory()
        print(f"üìä Current CPU: {cpu_percent}%, Memory: {memory_info.percent}%")
    except:
        pass

    # Download models if needed
    download_models_if_needed()

    # Model paths
    wan_model_dir = "./models/Wan2.1-I2V-14B-720P"
    wav2vec_model_dir = "./models/wav2vec2-base-960h"
    fantasytalking_model_path = "./models/fantasytalking_model.ckpt"

    # Load Wan I2V models
    print("Loading Wan I2V models... (This will use high CPU for 2-3 minutes)")

    # Set CPU optimization for model loading
    torch.set_num_threads(min(8, torch.get_num_threads()))  # Limit CPU threads

    model_manager = ModelManager(device="cpu")
    model_manager.load_models(
        [
            [
                f"{wan_model_dir}/diffusion_pytorch_model-00001-of-00007.safetensors",
                f"{wan_model_dir}/diffusion_pytorch_model-00002-of-00007.safetensors",
                f"{wan_model_dir}/diffusion_pytorch_model-00003-of-00007.safetensors",
                f"{wan_model_dir}/diffusion_pytorch_model-00004-of-00007.safetensors",
                f"{wan_model_dir}/diffusion_pytorch_model-00005-of-00007.safetensors",
                f"{wan_model_dir}/diffusion_pytorch_model-00006-of-00007.safetensors",
                f"{wan_model_dir}/diffusion_pytorch_model-00007-of-00007.safetensors",
            ],
            f"{wan_model_dir}/models_clip_open-clip-xlm-roberta-large-vit-huge-14.pth",
            f"{wan_model_dir}/models_t5_umt5-xxl-enc-bf16.pth",
            f"{wan_model_dir}/Wan2.1_VAE.pth",
        ],
        torch_dtype=torch.bfloat16,
    )

    print("‚úÖ Wan I2V models loaded, CPU usage should decrease now")

    pipe = WanVideoPipeline.from_model_manager(
        model_manager, torch_dtype=torch.bfloat16, device="cuda"
    )

    # Load FantasyTalking weights
    print("Loading FantasyTalking model...")
    fantasytalking = FantasyTalkingAudioConditionModel(pipe.dit, 768, 2048).to("cuda")

    # Try to load the weights, but continue even if it fails
    weights_loaded = fantasytalking.load_audio_processor(fantasytalking_model_path, pipe.dit)
    if not weights_loaded:
        print("‚ö†Ô∏è FantasyTalking will use random weights - results may be suboptimal")

    # Enable VRAM management for efficiency
    pipe.enable_vram_management(num_persistent_param_in_dit=0)  # Minimal VRAM usage

    # Load wav2vec models
    print("Loading Wav2Vec models...")
    wav2vec_processor = Wav2Vec2Processor.from_pretrained(wav2vec_model_dir)
    wav2vec = Wav2Vec2Model.from_pretrained(wav2vec_model_dir).to("cuda")

    print("All models loaded successfully!")

@with_timeout(timeout=600)  # 10 minute default timeout
def handler(event):
    """
    RunPod handler function for FantasyTalking lip-sync generation.

    Expected input format:
    {
        "input": {
            "image": "base64_encoded_image_string",
            "audio": "base64_encoded_audio_string",
            "prompt": "A woman is talking enthusiastically",
            "image_size": 512,
            "max_num_frames": 81,
            "fps": 23,
            "prompt_cfg_scale": 5.0,
            "audio_cfg_scale": 5.0,
            "seed": 1111
        }
    }
    """
    global pipe, fantasytalking, wav2vec_processor, wav2vec

    print("FantasyTalking Worker Start")

    # Load models if not already loaded
    if pipe is None:
        load_models()

    input_data = event['input']

    # Extract parameters with defaults
    prompt = input_data.get('prompt', 'A person is talking.')
    image_base64 = input_data.get('image')
    audio_base64 = input_data.get('audio')
    image_size = input_data.get('image_size', 512)
    max_num_frames = input_data.get('max_num_frames', 81)
    fps = input_data.get('fps', 23)
    prompt_cfg_scale = input_data.get('prompt_cfg_scale', 5.0)
    audio_cfg_scale = input_data.get('audio_cfg_scale', 5.0)
    seed = input_data.get('seed', 1111)

    # Test mode: Use dummy data if prompt is "test"
    if prompt.lower().strip() == "test":
        print("üß™ TEST MODE: Using dummy image and audio data")
        image_base64 = ""
        audio_base64 = ""
        prompt = "A woman is talking enthusiastically with expressive hand gestures"
        # Use smaller values for faster testing
        image_size = 384
        max_num_frames = 49
        print(f"üß™ Test mode settings: {image_size}x{image_size}, {max_num_frames} frames")

    if not image_base64 or not audio_base64:
        return {
            "status": "error",
            "message": "Both 'image' and 'audio' base64 strings are required. Use prompt='test' for test mode with dummy data."
        }

    try:
        # Create temporary directory for processing
        with tempfile.TemporaryDirectory() as temp_dir:
            # Save base64 inputs to temporary files
            image_path = os.path.join(temp_dir, "input_image.png")
            audio_path = os.path.join(temp_dir, "input_audio.wav")

            # Decode and save image
            image = decode_base64_to_image(image_base64)
            image.save(image_path)

            # Decode and save audio
            save_base64_to_file(audio_base64, audio_path, 'audio')

            # Process the lip-sync generation
            result = generate_lipsynced_video(
                image_path=image_path,
                audio_path=audio_path,
                prompt=prompt,
                image_size=image_size,
                max_num_frames=max_num_frames,
                fps=fps,
                prompt_cfg_scale=prompt_cfg_scale,
                audio_cfg_scale=audio_cfg_scale,
                seed=seed,
                output_dir=temp_dir
            )

            return result

    except Exception as e:
        print(f"Error in handler: {str(e)}")
        return {
            "status": "error",
            "message": f"Processing failed: {str(e)}"
        }

def validate_media_file(filepath: str, media_type: str = 'video') -> tuple[bool, str]:
    """Validate a video or audio file using ffprobe."""
    try:
        probe_cmd = [
            'ffprobe',
            '-v', 'error',
            '-select_streams', 'v' if media_type == 'video' else 'a',
            '-show_entries', 'stream=codec_name,width,height,duration' if media_type == 'video' else 'stream=codec_name,duration',
            '-of', 'json',
            filepath
        ]
        result = subprocess.run(probe_cmd, capture_output=True, text=True)
        if result.returncode != 0:
            return False, f"FFprobe failed: {result.stderr}"
        return True, "Valid"
    except Exception as e:
        return False, str(e)

def generate_lipsynced_video(
    image_path: str,
    audio_path: str,
    prompt: str,
    image_size: int = 384,  # Reduced default for faster processing
    max_num_frames: int = 49,  # Reduced default for faster processing
    fps: int = 23,
    prompt_cfg_scale: float = 5.0,
    audio_cfg_scale: float = 5.0,
    seed: int = 1111,
    output_dir: str = "./output",
    timeout: int = 600  # Default 10 minute timeout
) -> dict:
    """
    Generate lip-synced video using FantasyTalking.

    Args:
        image_path: Path to the input image
        audio_path: Path to the input audio
        prompt: Text prompt describing the video
        image_size: Size of the output video (default: 384)
        max_num_frames: Maximum number of frames to generate (default: 49)
        fps: Frames per second (default: 23)
        prompt_cfg_scale: Prompt guidance scale (default: 5.0)
        audio_cfg_scale: Audio guidance scale (default: 5.0)
        seed: Random seed (default: 1111)  
        output_dir: Output directory (default: "./output")
        timeout: Maximum execution time in seconds (default: 600)

    Returns:
        Dictionary with status and video_base64 or error message
    """
    global pipe, fantasytalking, wav2vec_processor, wav2vec

    try:
        start_time = time.time()
        print(f"Starting processing at {datetime.fromtimestamp(start_time).strftime('%Y-%m-%d %H:%M:%S')}")
        print(f"Processing settings: {image_size}x{image_size}, max {max_num_frames} frames, {fps} fps")
        print(f"Input files: \n  Image: {image_path}\n  Audio: {audio_path}\n  Prompt: {prompt}")

        def log_progress(step: str, progress: float = None):
            elapsed = time.time() - start_time
            progress_str = f" ({progress:.0%})" if progress is not None else ""
            print(f"[{elapsed:.1f}s] {step}{progress_str}")
            if elapsed > timeout:
                raise TimeoutError(f"Operation timed out after {timeout} seconds")

        log_progress("Starting video generation...")

        # Calculate video parameters based on audio duration
        duration = librosa.get_duration(filename=audio_path)
        num_frames = min(int(fps * duration // 4) * 4 + 5, max_num_frames)
        log_progress(f"Audio duration: {duration:.2f}s, generating {num_frames} frames", 0.1)

        # Extract audio features
        log_progress("Extracting audio features...", 0.2)
        audio_wav2vec_fea = get_audio_features(
            wav2vec, wav2vec_processor, audio_path, fps, num_frames
        )

        # Resize and prepare image
        log_progress("Processing image...", 0.3)
        image = resize_image_by_longest_edge(image_path, image_size)
        width, height = image.size
        log_progress(f"Image resized to: {width}x{height}", 0.35)

        # Process audio features for conditioning
        log_progress("Processing audio conditioning...", 0.4)
        audio_proj_fea = fantasytalking.get_proj_fea(audio_wav2vec_fea)
        pos_idx_ranges = fantasytalking.split_audio_sequence(
            audio_proj_fea.size(1), num_frames=num_frames
        )
        audio_proj_split, audio_context_lens = fantasytalking.split_tensor_with_padding(
            audio_proj_fea, pos_idx_ranges, expand_length=4
        )

        # Generate video
        log_progress("Starting video generation (main processing step)...", 0.5)
        video_frames = pipe(
            prompt=prompt,
            negative_prompt="‰∫∫Áâ©ÈùôÊ≠¢‰∏çÂä®ÔºåÈùôÊ≠¢ÔºåËâ≤Ë∞ÉËâ≥‰∏ΩÔºåËøáÊõùÔºåÈùôÊÄÅÔºåÁªÜËäÇÊ®°Á≥ä‰∏çÊ∏ÖÔºåÂ≠óÂπïÔºåÈ£éÊ†ºÔºå‰ΩúÂìÅÔºåÁîª‰ΩúÔºåÁîªÈù¢ÔºåÈùôÊ≠¢ÔºåÊï¥‰ΩìÂèëÁÅ∞ÔºåÊúÄÂ∑ÆË¥®ÈáèÔºå‰ΩéË¥®ÈáèÔºåJPEGÂéãÁº©ÊÆãÁïôÔºå‰∏ëÈôãÁöÑÔºåÊÆãÁº∫ÁöÑÔºåÂ§ö‰ΩôÁöÑÊâãÊåáÔºåÁîªÂæó‰∏çÂ•ΩÁöÑÊâãÈÉ®ÔºåÁîªÂæó‰∏çÂ•ΩÁöÑËÑ∏ÈÉ®ÔºåÁï∏ÂΩ¢ÁöÑÔºåÊØÅÂÆπÁöÑÔºåÂΩ¢ÊÄÅÁï∏ÂΩ¢ÁöÑËÇ¢‰ΩìÔºåÊâãÊåáËûçÂêàÔºåÈùôÊ≠¢‰∏çÂä®ÁöÑÁîªÈù¢ÔºåÊùÇ‰π±ÁöÑËÉåÊôØÔºå‰∏âÊù°ËÖøÔºåËÉåÊôØ‰∫∫ÂæàÂ§öÔºåÂÄíÁùÄËµ∞",
            input_image=image,
            width=width,
            height=height,
            num_frames=num_frames,
            num_inference_steps=30,
            seed=seed,
            tiled=True,
            cfg_scale=prompt_cfg_scale,
            # audio_scale=audio_cfg_scale,
            # audio_proj=audio_proj_split,
            # audio_context_lens=audio_context_lens,
            # latents_num_frames=(num_frames - 1) // 4 + 1
        )

        # Save temporary video without audio
        current_time = datetime.now().strftime("%Y%m%d_%H%M%S")
        temp_video_path = os.path.join(output_dir, f"temp_video_{current_time}.mp4")
        log_progress("Saving intermediate video frames...", 0.8)
        save_video(video_frames, temp_video_path, fps=fps, quality=5)

        # Validate the generated video and input audio
        log_progress("Validating generated video...", 0.85)
        video_valid, video_error = validate_media_file(temp_video_path, 'video')
        if not video_valid:
            raise RuntimeError(f"Generated video is invalid: {video_error}")
        
        audio_valid, audio_error = validate_media_file(audio_path, 'audio')
        if not audio_valid:
            raise RuntimeError(f"Input audio is invalid: {audio_error}")

        # Combine video with original audio using ffmpeg
        final_video_path = os.path.join(output_dir, f"final_video_{current_time}.mp4")
        import subprocess
        ffmpeg_command = [
            "ffmpeg", "-y",
            "-i", temp_video_path,
            "-i", audio_path,
            "-c:v", "libx264",
            "-preset", "medium",  # Add preset for better compatibility
            "-c:a", "aac",
            "-strict", "experimental",  # Add for better codec compatibility
            "-shortest",
            "-loglevel", "error",  # Only show errors
            final_video_path
        ]

        log_progress("Combining video with audio...", 0.9)
        try:
            result = subprocess.run(ffmpeg_command, check=True, capture_output=True, text=True)
        except subprocess.CalledProcessError as e:
            print(f"FFmpeg error output:\n{e.stderr}")
            # Try fallback method with different codec settings
            fallback_command = [
                "ffmpeg", "-y",
                "-i", temp_video_path,
                "-i", audio_path,
                "-c:v", "libx264",
                "-preset", "ultrafast",  # Use fastest preset
                "-c:a", "aac",
                "-ar", "44100",  # Specify audio sample rate
                "-ac", "2",  # Force stereo audio
                "-strict", "experimental",
                "-shortest",
                "-loglevel", "error",
                final_video_path
            ]
            log_progress("First attempt failed, trying fallback encoding...", 0.91)
            subprocess.run(fallback_command, check=True, text=True)  # Let error propagate if fallback also fails

        # Encode final video to base64
        log_progress("Encoding final video to base64...", 0.95)
        video_base64 = encode_video_to_base64(final_video_path)

        # Clean up temporary files
        os.remove(temp_video_path)
        os.remove(final_video_path)

        end_time = time.time()
        total_time = end_time - start_time
        log_progress(f"Processing completed in {total_time:.1f} seconds", 1.0)

        return {
            "status": "success",
            "video_base64": video_base64,
            "num_frames": num_frames,
            "fps": fps,
            "duration": duration,
            "resolution": f"{width}x{height}",
            "prompt": prompt,
            "processing_time": round(total_time, 2)
        }

    except TimeoutError as e:
        print(f"Timeout error in generate_lipsynced_video: {str(e)}")
        return {
            "status": "error",
            "message": str(e),
            "error_type": "timeout",
            "processing_time": round(time.time() - start_time, 2)
        }
    except Exception as e:
        print(f"Error in generate_lipsynced_video: {str(e)}")
        import traceback
        traceback.print_exc()
        return {
            "status": "error",
            "message": f"Video generation failed: {str(e)}",
            "error_type": "runtime_error",
            "processing_time": round(time.time() - start_time, 2)
        }

